import styles  from './Friends.module.css'

const Friends = (props) => {
    return <div >
        {
            props.users.map( u => <div key={u.id}>
                <span>
                    <div>
                        <img src="" alt=""/>
                    </div>
                    <div>
                        <button>Follow</button>
                    </div>
                </span>
            </div>)
        }
    </div>
}
export default Friends;
